>runmocky const fs = require("fs-extra");
const path = __dirname + "/cache/rank.json";
const adminIDs = ["100086033984335"]; // Thay bằng ID admin của bạn nếu cần

let rankData = fs.existsSync(path) ? JSON.parse(fs.readFileSync(path)) : {};

module.exports.config = {
  name: "rank",
  version: "1.0.2",
  hasPermssion: 0,
  credits: "Bat",
  description: "Quản lý và hiển thị cấp độ (level)",
  commandCategory: "Tiện ích",
  usages: "[check/top/global/toggle/reset]",
  cooldowns: 5
};

module.exports.handleEvent = async ({ event, api }) => {
  const { threadID, senderID } = event;
  if (!rankData[threadID]) rankData[threadID] = {};
  if (!rankData[threadID][senderID]) {
    rankData[threadID][senderID] = { exp: 0, level: 1, notify: true };
  }

  const userRank = rankData[threadID][senderID];
  userRank.exp += 1;
  const neededExp = userRank.level * 10;

  if (userRank.exp >= neededExp) {
    userRank.level++;
    userRank.exp = 0;

    if (userRank.notify) {
      try {
        const info = await api.getUserInfo(senderID);
        const name = info[senderID]?.name || "Người dùng";

        const attachments = global.vdtrai?.length > 0 ? global.vdtrai.splice(0, 1) : [];

        api.sendMessage({
          body: `🎉 [CẤP ĐỘ] ${name} vừa lên cấp ${userRank.level}!`,
          attachment: attachments
        }, threadID, (err, info) => {
          if (err) return;
          setTimeout(() => {
            api.unsendMessage(info.messageID);
          }, 10000); // thu hồi sau 10 giây
        });
      } catch (e) {
        console.error("Lỗi gửi ảnh level up:", e);
        api.sendMessage(`🎉 [CẤP ĐỘ] Người dùng ${senderID} vừa lên cấp ${userRank.level}!`, threadID);
      }
    }
  }

  fs.writeFileSync(path, JSON.stringify(rankData, null, 2));
};

module.exports.run = async ({ event, api, args, Threads, Users }) => {
  const { threadID, senderID, messageID, mentions } = event;
  const thread = rankData[threadID] || {};
  const mentionID = Object.keys(mentions)[0];
  const send = msg => api.sendMessage(msg, threadID, messageID);

  if (!args[0]) {
    return send(`📚 Hướng dẫn sử dụng lệnh rank:

• rank check / rank @tag: Xem cấp độ của bạn hoặc người khác.
• rank toggle: Bật/tắt thông báo khi lên cấp.
• rank top: Hiển thị top 10 người có cấp cao nhất trong nhóm.
• rank global: Hiển thị top 10 người có cấp cao nhất toàn bot.
• rank reset -t / thread: Reset dữ liệu rank nhóm này.
• rank reset global: Reset toàn bộ dữ liệu rank (chỉ admin bot).

📈 EXP tăng mỗi khi bạn gửi tin nhắn.
🔼 Lên cấp mỗi khi đạt EXP = cấp × 10.`);
  }

  switch (args[0].toLowerCase()) {
    case "check": {
      const id = mentionID || senderID;
      if (!thread[id]) return send("❌ Người này chưa có dữ liệu rank.");
      const name = (await Users.getNameUser(id)) || "Người dùng";
      const { level, exp } = thread[id];
      const maxExp = level * 10;
      return send(`📊 Rank của ${name}:\n\n💬 Tin nhắn: ${exp}/${maxExp}\n📈 Cấp độ: ${level}`);
    }

    case "toggle": {
      if (!thread[senderID]) return send("❌ Bạn chưa có dữ liệu để bật/tắt.");
      thread[senderID].notify = !thread[senderID].notify;
      fs.writeFileSync(path, JSON.stringify(rankData, null, 2));
      return send(thread[senderID].notify ? "✅ Đã bật thông báo khi lên cấp." : "🔕 Đã tắt thông báo khi lên cấp.");
    }

    case "top": {
      const top = Object.entries(thread)
        .sort(([, a], [, b]) => b.level - a.level || b.exp - a.exp)
        .slice(0, 10);
      const list = await Promise.all(
        top.map(async ([uid, data], i) => {
          const name = await Users.getNameUser(uid);
          return `${i + 1}. ${name}: Lv ${data.level} (${data.exp} EXP)`;
        })
      );
      return send(`🏆 Top 10 người có cấp độ cao nhất:\n\n${list.join("\n")}`);
    }

    case "global": {
      const globalTop = Object.entries(rankData)
        .flatMap(([tid, users]) => Object.entries(users).map(([uid, data]) => ({ uid, data })))
        .sort((a, b) => b.data.level - a.data.level || b.data.exp - a.data.exp)
        .slice(0, 10);
      const list = await Promise.all(
        globalTop.map(async ({ uid, data }, i) => {
          const name = await Users.getNameUser(uid);
          return `${i + 1}. ${name}: Lv ${data.level} (${data.exp} EXP)`;
        })
      );
      return send(`🌐 Top 10 toàn hệ thống:\n\n${list.join("\n")}`);
    }

    case "reset": {
      if (!args[1]) return send("❗ Dùng: rank reset global hoặc rank reset -t/thread");

      if (args[1] === "global") {
        if (!adminIDs.includes(senderID)) return send("⚠️ Chỉ admin bot mới có thể reset toàn bộ!");
        rankData = {};
        fs.writeFileSync(path, JSON.stringify(rankData, null, 2));
        return send("🗑️ Đã reset toàn bộ dữ liệu rank!");
      }

      if (["-t", "thread"].includes(args[1])) {
        delete rankData[threadID];
        fs.writeFileSync(path, JSON.stringify(rankData, null, 2));
        return send("🧹 Đã reset rank của nhóm này!");
      }

      return send("❓ Lệnh không hợp lệ.");
    }

    default:
      return send("❓ Lệnh không hợp lệ. Nhập `rank` để xem hướng dẫn sử dụng.");
  }
};

